VERIFICATION_FAQ_ANSWER_1_V2:"Before getting Verified, be sure to check out our [Verified Server Requirements](https://support.discord.com/hc/articles/360001107231) and review our [Community Guidelines]({guidelinesURL}) before applying.",VERIFICATION_FAQ_QUESTION_2:"Our server is fan run. Can we still apply?",VERIFICATION_FAQ_ANSWER_2_V2:"Unfortunately, we won’t be verifying fan servers. For example, if you’re a big fan of a certain game or musician and you run a server about them, we can’t verify you. Alternatively, the [Partner Program]({partnerURL}) is designed to reward the best servers that invest time and effort on Discord and is open to community-led servers.",VERIFICATION_FAQ_QUESTION_3:"I have a question. Who can I contact?",VERIFICATION_FAQ_ANSWER_3_V2:"Please contact us here. [dis.gd/cprog](https://dis.gd/cprog)",VERIFICATION_FAQ_QUESTION_4:"What are the perks of being Verified?",
