VERIFICATION_REFRESH_METADATA_TITLE:"Verify Your Server | Server Verification | Discord",VERIFICATION_REFRESH_METADATA_DESCRIPTION:"Verify your server so fans and followers can find and recognize your official server.",PARTNERS_METADATA_TITLE:"Partners",PARTNERS_METADATA_OGTITLE:"Become a Discord Partner - Exclusive Perks and Rewards",PARTNERS_METADATA_DESCRIPTION:"Become a Discord Partner and brand your Discord server with a custom link and invite splash image. Oh yeah, there's a sweet Discord Partner hoodie too.",PARTNERS_HERO_LABEL:"Discord Partners",PARTNERS_HERO_HEADING:"Discord Partner Program",PARTNERS_HERO_TEXT:"We want to support communities that invest time and effort on Discord. Get rewarded for creating an engaged community with our Partner Program.",PARTNERS_HOW_TO_APPLY:"How to apply",PARTNERS_ABOUT_TITLE:"What it's all about",
PARTNERS_ABOUT_SUBTITLE:"Designed for active and engaged communities, the Partner Program distinguishes the best servers out there. As role models to all of Discord, Partnered servers are communities that both our new and veteran users can use as inspiration to create their own communities.",PARTNERS_ABOUT_BRANDING_TITLE:"Unique branding",PARTNERS_ABOUT_BRANDING_SUBTITLE:"Personalize your server with a Custom URL, Server Banner, and Invite Splash.",PARTNERS_ABOUT_PERKS_TITLE:"Partner-only perks",PARTNERS_ABOUT_PERKS_SUBTITLE:"Get Discord Nitro, rewards for your community, and access to the Partners-only server.",PARTNERS_ABOUT_RECOGNIZED_TITLE:"Be recognized",PARTNERS_ABOUT_RECOGNIZED_SUBTITLE:"Receive a special badge on your server and stand out from the crowd on our Discovery page.",PARTNERS_APPLY_STEP_SET_COMMUNITY_LABEL:"Step 1",
PARTNERS_APPLY_STEP_SET_COMMUNITY_TEXT:"Label your server as a [Community Server](https://support.discord.com/hc/articles/360047132851). This is done in Discord under your Server Settings.",PARTNERS_APPLY_STEP_ENGAGEMENT_LABEL:"Step 2",PARTNERS_APPLY_STEP_ENGAGEMENT_TEXT:"Once you’ve set your server to Community, you should see a Partner Program tab. You’ll need to hit certain engagement stats before you can apply. Read the requirements [here](https://support.discord.com/hc/articles/115001494012).",PARTNERS_APPLY_WHATS_NEXT_TITLE:"Done and done. So, what’s next?",
PARTNERS_APPLY_WHATS_NEXT_SUBTITLE:"While Partnership is not guaranteed, we’d love to hear from you. If you’ve followed the steps above, apply within Discord under the Partner Program tab and we’ll get back to you as fast as bureaucracy will let us. Remember, it’s not just about the numbers. We take an overall look at your community. Acceptance is based on both quantitative and qualitative factors, and may vary from one candidate to the next.",PARTNERS_FEATURED_TITLE:"Meet our Partners",PARTNERS_FEATURED_SUBTITLE:"Whether you’re a community about learning how to cook, a server about fantasy sports, fans of your favorite game, or anything in between, we support engaged communities and content creators.",PARTNERS_FEATURED_SPECTRUM_DESCRIPTION:"Relationships & Identity, General Chatting",PARTNERS_FEATURED_AP_STUDENTS_DESCRIPTION:"Education",PARTNERS_FEATURED_BNANS_DESCRIPTION:"Gaming, Content Creator",PARTNERS_FAQ_QUESTION_1:"What do you look for in Partners?",
PARTNERS_FAQ_ANSWER_1_1:"Someone who appreciates me for who I am and likes long walks on the beaches and candle-lit dinners and... wait, I think I misread the question.",PARTNERS_FAQ_ANSWER_1_2:"Really, we look for thriving communities and content creators that show an authentic enthusiasm for Discord. We want to support communities that support us. Numbers on other platforms don’t always represent a engaged Discord community, so we don’t require specific, non-Discord related numbers like views or followers. Acceptance as a Partner is based on your server. More details on what we use to determine acceptance be found above or in our [Help Center article](https://support.discord.com/hc/articles/115001494012). However, meeting these requirements does not guarantee acceptance. Acceptance is based on both quantitative and qualitative factors, and will vary from one candidate to the next.",
PARTNERS_FAQ_QUESTION_2:"What numbers do I have to hit as a community to be accepted into the Partner Program?",PARTNERS_FAQ_ANSWER_2:"Numbers on other platforms don’t always represent an active Discord community, so we no longer require non-Discord related numbers like views or followers on other platforms. Instead, acceptance as a Partner is based on your server. Details on what we use to determine acceptance be found in our [Help Center article](https://support.discord.com/hc/articles/115001494012).",PARTNERS_FAQ_QUESTION_3:"What perks does my community get from this?",PARTNERS_FAQ_ANSWER_3:"Aside from the perks listed above, your server will also get a better bitrate, which is fancy talk for your voice channels will sound better. We’re also working on new ways to keep members excited about being a part of your community.",PARTNERS_FAQ_QUESTION_4:"What do I get as an applicant/server owner?",
PARTNERS_FAQ_ANSWER_4:"Aside from everything listed above, we’re always working on new rewards and perks that will encourage communites to stay healthy and engaged with our program. Make sure you join the official Partner server after acceptance and sign up for our newsletter to stay up to date on the program.",PARTNERS_CTA_TITLE:"Ready to start your journey?",PARTNERS_CATEGORY_SCIENCE_TECH:"Science & Tech",PARTNERS_CATEGORY_SPORTS:"Sports",PARTNERS_CATEGORY_GAMING:"Gaming",PARTNERS_CATEGORY_ANIME_MANGA:"Anime & Manga",PARTNERS_CATEGORY_EDUCATION_SCIENCE:"Education, Science & Tech",PARTNERS_CATEGORY_CONTENT_CREATOR:"Content Creator",PARTNERS_CATEGORY_WRITING_ART:"Writing & Creative Arts",PARTNERS_CATEGORY_MUSIC:"Music",PARTNERS_PERK_SERVER_TITLE:"Personalize your server",PARTNERS_PERK_SERVER:"Welcome new members to your server with custom splash art of your choosing and a personal discord.gg link to call your own.",PARTNERS_PERK_VIP_TITLE:"Access to robust VIP voice servers",
