SAFETY_METADATA_TITLE:"Safety Principles and Policies | Discord",SAFETY_METADATA_DESCRIPTION:"We're determined to ensure that Discord is a welcoming place for you. Learn more about our safety principles.",SAFETY_CATEGORY_LANDING_TITLE_NAVBAR:"Safety Center",SAFETY_LANDING_HERO_TITLE:"Discord Safety Center",
SAFETY_LANDING_HERO_BODY:"Discord is a place designed for talking and hanging out with your communities and friends. Millions of diverse communities are on Discord including school clubs, gaming groups, art communities, and groups of friends spending time together.\n\nThe space for each community on Discord is called a server. Discord servers are invite-only places where you can talk, collaborate, and share. Conversations on servers are only with people you choose to talk to and about the topics you want to discuss. In this way and many others, Discord is not a traditional social media platform. There is no algorithm deciding what you should see. There’s no endless scrolling, no news feed, and no counting of likes.\n\nWe built this Safety Center to ensure that everyone feels comfortable and confident on Discord. We want to help you understand how we think about and prioritize safety, the policies we have in place, and how you can control your experience.",
SAFETY_PRINCIPLES_TITLE:"Our Safety Principles",SAFETY_PRINCIPLES_BODY:"These principles guide us every day, ensuring Discord is always safe and secure for everyone.",SAFETY_PRINCIPLE_RESPONSIBILITY_TITLE:"With great power comes great responsibility.",SAFETY_PRINCIPLE_RESPONSIBILITY_SUBTITLE:"There’s a huge responsibility in being a place where millions of people talk to each other every day, and we want Discord to always be a welcoming place for you and your friends. We do not sell your data, nor do we share it with third parties for advertising purposes.",SAFETY_PRINCIPLE_CONTROL_TITLE:"We give you the tools to control your experience.",SAFETY_PRINCIPLE_CONTROL_SUBTITLE:"We’ve created tools for server owners to moderate their spaces. These tools allow you to enforce your rules and norms for your unique community. You can find out more about these tools here in the Safety Center.",SAFETY_PRINCIPLE_SAFETY_TITLE:"We take public safety very seriously.",
SAFETY_PRINCIPLE_SAFETY_SUBTITLE:"We put your privacy first and as a rule do not scan or read your messages. However, we can do so for safety reasons. If an issue arises, we will investigate, review the situation, and take proper action. We know there are cases where bad actors are acting to cause violence or harm in the real world, and we make it clear to them that they don’t have a place on Discord.",SAFETY_PRINCIPLE_IDENTITY_TITLE:"Your identity is yours.",SAFETY_PRINCIPLE_IDENTITY_SUBTITLE:"Your account doesn’t have to be tied back to your real world identity — we want to make sure that everyone can be their true self and feel comfortable when they talk on Discord. But that **doesn’t** mean that someone can avoid consequences for their actions.",SAFETY_GUIDELINES_TITLE:"Our Community Guidelines",
SAFETY_GUIDELINES_BODY:"We want Discord to be a safe, positive, and inclusive experience. For that to happen, we must all agree to a set of rules that guide our interactions on Discord.\n\nWhen you sign up to Discord, you agree to follow our [Community Guidelines]({guidelinesURL}) and refrain from behavior that isn’t allowed on the service. In exchange, it’s our job to make sure your experience is as amazing as it can be.\n\nWe have a zero-tolerance approach to anyone threatening other people with harm, sharing sexually explicit content of others without their consent, sharing content that glorifies or promotes self-harm, and illegal activities such as sharing child sexual abuse material. If you come across a message that appears to break these rules, you can report it to your server moderator or directly to us by [filling out this form]({reportFormURL}). We may take a number of steps including issuing a warning, removing the content, or removing the accounts and/or servers responsible.\n\n**For more information, please see the other parts of this Safety Center as well as our [Help Center]({helpCenterURL}).**",
SAFETY_TABLE_OF_CONTENTS_HEADING:"Contents",SAFETY_REBRAND_LANDING_HERO_BODY:"Discord is a place dedicated to talking and hanging out with your friends, family and communities. Millions of diverse communities are on Discord, from small groups of old friends to huge servers where hundreds of thousands of people can connect over shared interests.\n\nDiscord isn’t a social media platform. There is no algorithm deciding what you should see, no endless scrolling, no news feed, no counting likes, no going viral. Instead, Discord is a place where everyone can be themselves and spend time with other people who share their interests and hobbies. Conversations on Discord are driven only by the people you choose and the topics you pick.",SAFETY_REBRAND_PRINCIPLES_TITLE:"Principles",
SAFETY_REBRAND_PRINCIPLES_BODY:"We want to make sure that Discord has the ability for everyone to have a safe, positive and inclusive experience, no matter what brought them here. For that to happen, we must all agree to a set of rules that govern our interactions on Discord. When you sign up to Discord, you agree to follow the rules below and refrain from behavior that isn’t allowed on the service.\n\nIn exchange, it’s our job to make sure your experience is everything it can be. Here are the principles that guide the society we want to create on Discord:",SAFETY_REBRAND_PRINCIPLE_RESPONSIBILITY_TITLE:"We’re determined to make sure that Discord will always be a welcoming place for you.",SAFETY_REBRAND_PRINCIPLE_RESPONSIBILITY_SUBTITLE:"There’s a huge responsibility in being a place where hundreds of millions of people talk to each other.",SAFETY_REBRAND_PRINCIPLE_CONTROL_TITLE:"Privacy is incredibly important to us.",
SAFETY_REBRAND_PRINCIPLE_CONTROL_SUBTITLE:"We do not monitor every server or every conversation. We do not sell your data, nor do we share it with third parties for advertising purposes.",SAFETY_REBRAND_PRINCIPLE_SAFETY_TITLE:"Safety is just as important.",SAFETY_REBRAND_PRINCIPLE_SAFETY_SUBTITLE:"We don’t sit back and simply wait for reports, but instead act to protect everyone on the platform. We know that there are cases where bad actors are acting to cause violence or harm in the real world, and we make it clear to them that there’s no place for them on Discord.",SAFETY_REBRAND_PRINCIPLE_IDENTITY_TITLE:"Finally, Discord is pseudonymous.",SAFETY_REBRAND_PRINCIPLE_IDENTITY_SUBTITLE:"Your account on Discord doesn’t have to be tied back to your identity, and we want to make sure that everyone can be their true self. But that doesn’t mean that someone can be free of the consequences of their actions.",SAFETYSEO_SAFE_ACCOUNT_TITLE:"Setting Up Your Account for Privacy & Safety | Discord",
